    public static int min(int a, int b, int c, int d) {
       // if a is the smallest return it
       if (a <= b && a <= c && a <= d) return a;

       // otherwise, if b is the smallest of b, c, and d, return it
       if (b <= c && b <= d) return b;

       // otherwise, return the smaller of c and d
       if (c <= d) return c;
       return d;
    }

    public static int min(int a, int b, int c, int d) {
       int min = a;
       if (b < min) min = b;
       if (c < min) min = c;
       if (d < min) min = d;
       return min;
    }

    public static int min(int a, int b, int c, int d) {
       if (a < b && a < c && a < d) return a;
       if (b < c && b < d)          return b;
       if (c < d)                   return c;
       return d;
    }

    public static int min(int a, int b, int c, int d) {
       if (a <= b) {
          if (a <= c) {
             if (a <= d)  return a;
             else return d;
          }
          if (c <= d) return c;
          else return d;
       }
       if (b <= c) {
          if (b <= d) return b;
          else return d;
       }
       else if (c <= d) return c;
       return d;
    }

    public static int min(int a, int b) {
       if (a <= b) return a;
       else        return b;
    }
    public static int min(int a, int b, int c, int d) {
       return min(min(a, b), min(c, d));
    }

